import React from 'react';
import { Button, TextField } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import './Login.css';
import blitzLogo from '../../Components/globalAssets/blitzLogo.png';

const Register = () => {
  const navigate = useNavigate();

  const handleLogin = () => {
    navigate('/dashboard');
  }

  return (
    <div className="login-container">
      {/* Left column */}
      <div className="logo-container">
        <img src = {blitzLogo} alt="blitzLogo" />
      </div>

      {/* Right column */}
      <div className="form-container">
  <h2>Welcome to Blitz!</h2>
  <p>Enter your information to continue with Blitz</p>

  <div className="field-row">
    <TextField className="field" label="First Name" variant="outlined" />
    <TextField className="field" label="Last Name" variant="outlined" />
  </div>

  <div className="field-row">
    <TextField className="field" label="Email" variant="outlined" />
    <TextField className="field" label="Desired Username" variant="outlined" />
  </div>

  <div className="field-row">
    <TextField className="field" label="Password" variant="outlined" />
    <TextField className="field" label="Re-enter Password" variant="outlined" type="password" />
  </div>
  
  <div className="field-row">
    <TextField className="field" label="Street Address" variant="outlined" />
    <TextField className="field" label="City" variant="outlined" type="password" />
  </div>

  <div className="field-row">
    <TextField className="field" label="State" variant="outlined" />
    <TextField className="field" label="Country" variant="outlined" type="password" />
  </div>

  <div className="field-row">
    <TextField className="field" label="SSN/Tax ID" variant="outlined" />
  </div>

  <Button variant="contained" color="primary" size="large" onClick={handleLogin} className="submit-button">
    Create Account 
  </Button>
</div>

      
    </div>
    
  );
}

export default Register;
